import './App.css';
import React,{useState,useEffect} from 'react';
import axios from "axios";

function App() {
  const [msgs, setmsg] = useState([]);
  useEffect(()=>{
    async function getAllMsg(){
      try{
        const msgs = await axios.get("http://127.0.0.1/msg/")
        console.log(msgs.data)
        setmsg(msgs.data)
      } catch (error) {
        console.log(error)
      }
    }
    getAllMsg()
  },[])
  return (
    <div className="App">
      <header className="App-header">
        <h3>Welcome to Ecocrypt..!</h3>
      </header>
      <div className='layout'>
        <div>
          {msgs.map(msg =>{
            return <h4>{msg.message}</h4>
          })
          }
        </div>
      </div>
    </div>
  );
}

export default App;
